import RegistroUsuario from '../modules/usuario/components/RegistroUsuario.vue';


import Vue from 'vue';
import Router from 'vue-router';

Vue.use(Router);

export default new Router({
  mode: 'history', // Elimina el hash (#) en la URL, opcional
  routes: [
    {
      path: '/Registro',
      name: 'Registro',
      component: RegistroUsuario, // Ruta principal
    }
  ]
});
